script: |
  super -f tsv -I q4533.sql | sort > q4533.out

vector: true

inputs:
  - name: q4533.sql
    data: |
      pragma pg
      SELECT DISTINCT - NULLIF ( + + col0, - - CAST ( NULL AS REAL ) ) AS col2 FROM tab2 AS cor0 GROUP BY col0, col2 HAVING - 41 + - col0 IS NOT NULL;
  - name: tab2

outputs:
  - name: q4533.out
    data: |
      -15
      -91
      -92
